      window.reportProps["appData"] = { data: { result: {"view_xml": "\u003cView version=\"1\" fragment=\"false\"\u003e\u003cSelect type=\"tabs\"\u003e\u003cGroup label=\"Event and Country Statistics\" columns=\"1\" valign=\"top\"\u003e\u003cSelect type=\"tabs\"\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"List of World Championships\" src=\"ref://02cc95c958\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"Countries competing at World Championships\" src=\"ref://e1dbcdd116\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"Athletes competing at World Championships\" src=\"ref://2d159171be\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"20 Largest Total Team size at World Championships\" src=\"ref://c2e1858f70\"/\u003e\u003cGroup label=\"2023 Registration Stats\" columns=\"2\" valign=\"top\"\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://b57784420f\" caption=\"Team Sizes\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://df237b590d\" caption=\"Number of Athletes by Discipline and Gender\"/\u003e\u003c/Group\u003e\u003cGroup label=\"2023 Debutants Stats\" columns=\"2\" valign=\"top\"\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://f3ed3998d4\" caption=\"First Senior World Event\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://60d0854c31\" caption=\"First Senior World Event\"/\u003e\u003c/Group\u003e\u003cText label=\"Analysis\"\u003e\u003c![CDATA[### Terminology  \n- An event is a set of competitions taking place at a single Venue over a continuous period.  \n- but in 2014 when the Wchamps were split, if you attended both, then it only counts as 1 wchamps.\n- A competition is for a single discipline for a gender (e.g Boulder female), multiple competitions take place at a single event.  \n\n### Highlights  \n- The most countries ever at a World Champs was 55 in 2011 and 2012, this year with 54 countries is a big increase on 2019 and 2021  \n- The most countries to compete in bouldering and Lead is 51 in 2012 and 2011 respectfully  \n- The most countries to compete in Speed is 38 in 2016  \n- Russia has sent the largest teams to a Wchamps, the largest was 35 in 2018  \n\n- This year is the first time that JPN and USA have the largest teams at a Wchamps both with a squad of 21 athletes  \n\n### Event stuff  \n- 3rd time in Switzerland, only France has hosted more with 4 WChamps, first time in Bern  \n- 18th Wchamps (counting 2014 as one wchamps which was spread over 2 events)]]\u003e\u003c/Text\u003e\u003c/Select\u003e\u003c/Group\u003e\u003cGroup label=\"World Chamionship Competition and Athlete Participation Statistics\" columns=\"1\" valign=\"top\"\u003e\u003cSelect type=\"tabs\"\u003e\u003cGroup label=\"Number of Boulder World Champs attended (male and female) - Top 20\" columns=\"2\" valign=\"top\"\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://5b24697f61\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://f2d741682c\"/\u003e\u003c/Group\u003e\u003cGroup label=\"Number of Lead World Champs attended (male and female) - Top 20\" columns=\"2\" valign=\"top\"\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://91954dcaee\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://fe3e66bfa1\"/\u003e\u003c/Group\u003e\u003cGroup label=\"Number of Speed World Champs attended (male and female) - Top 20\" columns=\"2\" valign=\"top\"\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://acfe44ccb1\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://3f3eef12f6\"/\u003e\u003c/Group\u003e\u003cGroup label=\"Number of Combined World Champs attended (male and female) - Top 20\" columns=\"2\" valign=\"top\"\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://7bbc26c239\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://bba408a4b4\"/\u003e\u003c/Group\u003e\u003cGroup label=\"Number of World Champs all disciplines attended (male and female) - Top 20\" columns=\"2\" valign=\"top\"\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://e87a3d6bf0\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://fece271d40\"/\u003e\u003c/Group\u003e\u003cText label=\"Highlights\"\u003e\u003c![CDATA[### Boulder  \n- Jain and Petra will be at their 8th Wchamps, 1 behind Akiyo  \n- Jernej and Sean will be at their 9th Wchamps, they hold the joint record  \n\n### Lead  \n- Jain will take the record with her 10th Wchamps in Lead  \n- Jakob and Sean will be at their 9th Wchamps, but the record is 10 Wchamps  \n\n### Speed  \n- Ola will be at her 7th Wchamps, but the record is 9 for women  \n- Marcin DZIENSKI will tie the male record at his 8th Wchamps  \n- Danyil BOLDYREV will tie the male record at his 8th Wchamps  \n\n### Total number of Comps at Wchamps\n- Jain Kim clear leader this will be her 23rd (B), 24th (L) and 25th (B\u0026L) comps at Wchamps\n- Sean McColl clear leader this will be his 28th (B), 29th (L) and 30th (B\u0026L) comps at Wchamps]]\u003e\u003c/Text\u003e\u003c/Select\u003e\u003c/Group\u003e\u003cGroup label=\"Country Results World Champs\" columns=\"1\" valign=\"top\"\u003e\u003cSelect type=\"tabs\"\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"World Championships Medal Table for Boulder\" src=\"ref://b2c1a8b269\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"World Championships Medal Table for Lead\" src=\"ref://e0f2fae7a0\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"World Championships Medal Table for Speed\" src=\"ref://90a2f1e8a9\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"World Championships Medal Table for Combined\" src=\"ref://a60a74506c\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"World Championships Medal Table for BoulderLead\" src=\"ref://51a08a5005\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"World Championships Medal Table for All disciplines\" src=\"ref://15f0e0af6f\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"Number of athletes per Country with World Championship wins and podiums for Boulder\" src=\"ref://b501e1708e\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"Number of athletes per Country with World Championship wins and podiums for Lead\" src=\"ref://a0f33f5e4a\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"Number of athletes per Country with World Championship wins and podiums for Speed\" src=\"ref://eac41d0746\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"Number of athletes per Country with World Championship wins and podiums for Combined\" src=\"ref://b2828ac16b\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"Number of athletes per Country with World Championship wins and podiums all disciplines\" src=\"ref://f1d0acaedf\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"Country best finishes by gender and discipline\" src=\"ref://bb4575f9de\"/\u003e\u003cText label=\"Highlights\"\u003e\u003c![CDATA[### Medal sets (a set is a medal in boulder,lead,speed for both genders)  \n- No country has a complete gold set of Medals, france is closest with 4, they need female boulder and speed to complete the set, Russia also has 4, they need male and female lead  \n- France has a male half-set of golds  \n- Italy has a female half-set of Golds  \n- USA are probably closest to getting a half-set, they need a female speed gold to complete a female set  \n\n- France is the only country to have a complete set of 6 podiums  \n- Italy have 5 podiums, they need a female speed podium to complete the set  \n- several countries have 4 podiums and have a chance of getting to 5  \n\n### Countries Medal League  \n-  Indonesia don\u0027t have any speed medals, surely that will change, they could leap up the Speed medal table  \n-  Unlikely the top spot on any of the country medal tables will change, but there will be movement within the top 5]]\u003e\u003c/Text\u003e\u003c/Select\u003e\u003c/Group\u003e\u003cGroup label=\"Country Results World Champs per Year\" columns=\"1\" valign=\"top\"\u003e\u003cSelect type=\"tabs\"\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"World Championships Medal Table for All disciplines per World Championship\" src=\"ref://6f258647be\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"World Championships Medal Table for Boulder\" src=\"ref://7d54963637\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"World Championships Medal Table for Lead\" src=\"ref://e29dfbba3e\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"World Championships Medal Table for Speed\" src=\"ref://b17386c694\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"World Championships Medal Table for Combined\" src=\"ref://d24c5b4874\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"World Championships Medal Table for BoulderLead\" src=\"ref://fcc21dba5b\"/\u003e\u003c/Select\u003e\u003c/Group\u003e\u003cGroup label=\"Youngest and Oldest Stats\" columns=\"1\" valign=\"top\"\u003e\u003cGroup columns=\"1\" valign=\"top\"\u003e\u003cText\u003e\u003c![CDATA[**Please treat the finalist and attendee data with caution as there are many athletes without a DoB**  \n    Phrase in a way that says we know of people who were atleast xx years old but we don\u0027t have a definitive youngest/oldest person  \n    Winner and Podium data is nearly 100% complete, so small chance of an error\n\nYoungest]]\u003e\u003c/Text\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://122a7ca57c\" caption=\"results including 2023 World Champs\"/\u003e\u003cText\u003e\u003c![CDATA[Oldest]]\u003e\u003c/Text\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://e4fc666650\" caption=\"results including 2023 World Champs\"/\u003e\u003c/Group\u003e\u003c/Group\u003e\u003cGroup label=\"Athlete Results\" columns=\"1\" valign=\"top\"\u003e\u003cSelect type=\"tabs\"\u003e\u003cGroup label=\"World Championship Boulder wins and podiums (male and female)\" columns=\"2\" valign=\"top\"\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://00d8c12731\" caption=\"results including 2023 World Champs\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://806f440e61\" caption=\"results including 2023 World Champs\"/\u003e\u003c/Group\u003e\u003cGroup label=\"World Championship Lead wins and podiums (male and female)\" columns=\"2\" valign=\"top\"\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://98b5f09e32\" caption=\"results including 2023 World Champs\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://1ec560b7fa\" caption=\"results including 2023 World Champs\"/\u003e\u003c/Group\u003e\u003cGroup label=\"World Championship Speed wins and podiums (male and female)\" columns=\"2\" valign=\"top\"\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://0679b151af\" caption=\"results including 2023 World Champs\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://494d5f6cdf\" caption=\"results including 2023 World Champs\"/\u003e\u003c/Group\u003e\u003cGroup label=\"World Championship Combined wins and podiums (male and female)\" columns=\"2\" valign=\"top\"\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://606ea8d90a\" caption=\"results including 2023 World Champs\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://ca6cd00ac5\" caption=\"results including 2023 World Champs\"/\u003e\u003c/Group\u003e\u003cGroup label=\"World Championship all disciplines wins and podiums (male and female)\" columns=\"2\" valign=\"top\"\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://48a5ee544a\" caption=\"results including 2023 World Champs\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://d48e26ea2a\" caption=\"results including 2023 World Champs\"/\u003e\u003c/Group\u003e\u003cGroup label=\"World Championship Boulder podium list (male and female)\" columns=\"1\" valign=\"top\"\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://02b0f2002e\" caption=\"Boulder\"/\u003e\u003c/Group\u003e\u003cGroup label=\"World Championship Lead podium list (male and female)\" columns=\"1\" valign=\"top\"\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://8728a1a78d\" caption=\"Lead\"/\u003e\u003c/Group\u003e\u003cGroup label=\"World Championship Speed podium list (male and female)\" columns=\"1\" valign=\"top\"\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://9e757e1fdd\" caption=\"Speed\"/\u003e\u003c/Group\u003e\u003cText\u003e\u003c![CDATA[### Country  \n- No medals for Indonesia, they must have a good chance in speed  \n\n### Female  \n- Janja has most golds across all disciplines (6)  \n- Janja and Akiyo tied on 7 medals  \n\n**Boulder** \n- Janja could overtake Anna Stohr and have the most golds in Bouldering if she wins (3)  \n- Natalia could get a 2nd boulding gold and match Anna and Janja  \n\n**Lead**  \n- Janja could take a 3rd lead Gold, but would still be behind Angela Eiter (4)  \n- Jain, Chaehyun and Jessie all have a chance to win a 2nd Gold and match Janja  \n\n**Speed**  \n- Ola could win a 3rd Gold and match the female reorc in Speed of Olena  \n- Natalia K could win a 2nd Gold and match Ola  \n- Everyone else would be a new winner  \n\n### Male  \n- Adam, Jakob and Qixin tied on most Golds across all disciplines
